def main():
    st.title("ML Match Cutting")
    st.title("\n##")
    
    
    col1, col2, col3, col4 = st.columns([3, 1, 1, 2])

    with col1:
        search_query = st.text_input("Search for a video", "Killing A Mockingbird")

    with col2:
        medium_shot = st.selectbox("Shot Type", ["All", "Close-up", "Medium", "Wide"], index=0)

    with col3:
        face_motion_filter = st.selectbox(
            "Face/Motion",
            ["All", "Has Faces", "No Faces", "High Motion", "Medium Motion", "Low Motion"],
            index=0,
        )

    filtered_results = [
        video for video in video_data
        if search_query.lower() in video["title"].lower()  
        and (face_motion_filter == "All" or
             (face_motion_filter == "Has Faces" and video["has_faces"]) or
             (face_motion_filter == "No Faces" and not video["has_faces"]) or
             (face_motion_filter == "High Motion" and video["motion"] == "high") or
             (face_motion_filter == "Medium Motion" and video["motion"] == "medium") or
             (face_motion_filter == "Low Motion" and video["motion"] == "low"))
    ]

    st.subheader(f"Results ({len(filtered_results)})")
    selected_videos = []

    for video in filtered_results:
        col1, col2 = st.columns([1, 4])
        with col1:
            st.image(video["thumbnail"], width=100)
        with col2:
            st.markdown(f"**{video['title']}**")
            st.caption(f"Timestamp: {video['timestamp']}")

            selected = st.checkbox(f"Select {video['title']}", key=video['timestamp'])
            if selected:
                selected_videos.append(video)

    with col4:
        if selected_videos:
            st.subheader("Selected Videos")
            for selected_video in selected_videos:
                st.markdown(f"**{selected_video['title']}** - {selected_video['timestamp']}")
        else:
            st.write("No videos selected.")

if __name__ == "__main__":
    main()